import React from "react";

const About = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "Right",
        alignItems: "Right",
        height: "100vh",
      }}
    >
      <h1>About</h1>
    </div>
  );
};

export default About;
